import React from "react";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Navigate,
} from "react-router-dom";
import Dashboard from "./components/Dashboard.jsx";
import UserManagement from "./components/UserManagement.jsx";
import TicketManagement from "./components/TicketManagement.jsx";
import OrderManagement from "./components/OrderManagement.jsx";
import PromotionManagement from "./components/PromotionManagement.jsx";
import Statistics from "./components/Statistics.jsx";

const App = () => {
  return (
    <Router>
      <Routes>
        {/* Điều hướng mặc định đến Dashboard */}
        <Route path="/" element={<Navigate to="/admin/dashboard" />} />
        <Route path="/admin/dashboard" element={<Statistics />} />
        <Route path="/admin/users" element={<UserManagement />} />
        <Route path="/admin/flights" element={<TicketManagement />} />
        <Route path="/admin/orders" element={<OrderManagement />} />
        <Route path="/admin/coupons" element={<PromotionManagement />} />
      </Routes>
    </Router>
  );
};

export default App;
